<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap" rel="stylesheet">
    <title>Document</title>
    <style>

        body { font-family: "Poppins", serif;
            text-align: center;
            color: #344054;
        }
        .maindiv {
            padding: 10px;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
        }
        .image {
            width: 250px;
            height: 250px;
        }

        .image img {
            max-width: 100%;
        }
        h3 {
            font-size: 32px;
            margin-bottom: 0;
        }
        .ttitle {
            font-size: 24px;
            margin-bottom: 50px;
            margin-top: 0;
        }
        .btn {
            padding: 20px 45px;
            background-color: #fff;
            border: 2px solid #000;
            font-size: 18px;
            border-radius: 4px;
            font-weight: bold;
            color: #344054;
            cursor: pointer;
            text-decoration: none;
        }
        .copy {
            font-size: 18px;
            margin: 20px auto;
        }
        a {
            font-size: 22px;
            color:#0071c1 ;
            margin-bottom: 40px;
        }

    </style>
</head>
<body>
<div class="maindiv">

    <div class="image">
        <img src="data:image/png;base64," alt="Edumart">
    </div>
    <h3>Youre Almost There!</h3>
    <p class="ttitle">You have been added as a user to edumart application, you can follow the registration process. </p>
    <a class="btn" href="{{$link}}">Follow Link</a>
    <p class="copy">Or copy and paste the url into your browser</p>
    <a href="{{$link}}">{{$link}}</a>
    <p class="footer"></p>
</div>
</body>
</html>
